USE sales;

CREATE TABLE `clean_sales` (
    `Order_ID` VARCHAR(255),
    `Order_Date` DATE,
    `Ship_Date` DATE,
    `Ship_Mode` VARCHAR(255),
    `Segment` VARCHAR(255),
    `City` VARCHAR(255),
    `State` VARCHAR(255),
    `Region` VARCHAR(255),
    `Category` VARCHAR(255),
    `Sales` DECIMAL(10, 2)
);








